import React from 'react';
import styled from 'styled-components';

const Nav = () => {
  return (
    <NavWrapper>
      <Logo onClick={() => (window.location.href = "/")}>
        <span>iTeaMoa</span>
      </Logo>

      <ToggleContainer>
        <ToggleLabel>STUDY</ToggleLabel>
        <ToggleSwitch type="checkbox" />
        <ToggleLabel>PROJECT</ToggleLabel>
      </ToggleContainer>

      <SearchContainer>
        <SearchInput placeholder="Search projects" />
        <SearchIcon>üîç</SearchIcon>
      </SearchContainer>



      <TagContainer>
        <Tag>AWS</Tag>
        <Tag>Blockchain</Tag>
        <Tag>NodeJS</Tag>
        <Tag>React</Tag>
        <Tag>Java</Tag>
      </TagContainer>

      <UserActions>
        <UserAction>Î°úÍ∑∏Ïù∏</UserAction>
        <UserAction>Í≥†Í∞ùÏÑºÌÑ∞</UserAction>
      </UserActions>

      <UserIcons>
        <UserIcon>üîî</UserIcon>
        <UserIcon>üí¨</UserIcon>
        <UserIcon>üë§</UserIcon>
      </UserIcons>
    </NavWrapper>
  );
}

export default Nav;

const NavWrapper = styled.nav`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  height: 20%; /* ÎÜíÏù¥Î•º Ï†ÅÏ†àÌûà Ï°∞Ï†ï */
  background-color: #ffffff;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 0 36px;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  z-index: 3;
`;

const Logo = styled.div`
  position: absolute; /* ÏúÑÏπòÎ•º Ï†àÎåÄÏ†ÅÏúºÎ°ú ÏÑ§Ï†ï */
  top: 50%; /* ÏÑ∏Î°ú Ï§ëÏïô */
  left: 50%; /* Í∞ÄÎ°ú Ï§ëÏïô */
  transform: translate(-50%, -50%); /* Ï§ëÏïô Ï†ïÎ†¨ÏùÑ ÏúÑÌïú Î≥ÄÌôò */
  cursor: pointer;
  font-size: 40px;
  color: #0080ff; /* Î°úÍ≥† ÏÉâÏÉÅ */
`;


const ToggleContainer = styled.div`
  display: flex;
  align-items: center;
  position: absolute;
  top: 90%;
  left: 50%;
  transform: translate(-50%, -50%);
  cursor: pointer;
  font-size: 24px;
`;

const ToggleLabel = styled.label`
  margin: 0 10px;
  font-size: 16px;
  color: #333;
`;

const ToggleSwitch = styled.input`
  appearance: none; /* Í∏∞Î≥∏ Ïä§ÌÉÄÏùº Ï†úÍ±∞ */
  width: 50px; /* Ïä§ÏúÑÏπò Ìè≠ */
  height: 30px; /* Ïä§ÏúÑÏπò ÎÜíÏù¥ */
  background: #ccc; /* ÎπÑÌôúÏÑ±Ìôî ÏÉÅÌÉú Î∞∞Í≤Ω */
  border-radius: 30px; /* Îë•Í∑º Î™®ÏÑúÎ¶¨ */
  position: relative;
  cursor: pointer;
  outline: none;

  &:checked {
    background: #62B9EC; /* ÌôúÏÑ±Ìôî ÏÉÅÌÉú Î∞∞Í≤Ω */
  }

  &:checked::before {
    transform: translateX(24px); /* ÌôúÏÑ±Ìôî ÏÉÅÌÉúÏóêÏÑú Ïù¥Îèô */
  }

  &::before {
    content: '';
    position: absolute;
    width: 26px; /* ÏõêÌòï Î≤ÑÌäº Ìè≠ */
    height: 26px; /* ÏõêÌòï Î≤ÑÌäº ÎÜíÏù¥ */
    top:40%
    border-radius: 50%; /* ÏõêÌòï Î≤ÑÌäº */
    background: white; /* ÏõêÌòï Î≤ÑÌäº Î∞∞Í≤Ω */
    transition: transform 0.2s; /* Î∂ÄÎìúÎü¨Ïö¥ Ïù¥Îèô Ìö®Í≥º */
  }
`;

// ÏÇ¨Ïö© ÏòàÏãú
<ToggleContainer>
  <ToggleSwitch type="checkbox" id="toggle" />
  <ToggleLabel htmlFor="toggle">ÌÜ†Í∏Ä Ïä§ÏúÑÏπò</ToggleLabel>
</ToggleContainer>


const SearchContainer = styled.div`

  margin: 0 20px;
  position: absolute;
  top: 100%;
  left: 37%; /* Í∞ÄÎ°ú Ï§ëÏïô */


`;

const SearchInput = styled.input`
  width: 100%;
  padding: 10px 40px;
  border: 2px solid #0080ff;
  border-radius: 20px;
  outline: none;
  font-size: 16px;
  background-color: #F3F0F0; /* Î∞∞Í≤Ω ÏÉâÏÉÅ ÏÑ§Ï†ï */
  &::placeholder {
    color: #aaa;
  }
`;

const SearchIcon = styled.span`
  position: absolute;
  right: 5%;
  top: 50%;
  transform: translate(250%, -50%);
  font-size: 20px;
  cursor: pointer; /* pointer-events ÏÜçÏÑ±ÏùÄ ÌïÑÏöîÌïòÏßÄ ÏïäÏùå */
`;

const TagContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  margin: 0 20px;
`;

const Tag = styled.div`
  margin: 5px;
  padding: 5px 10px;
  border: 1px solid #0080ff;
  border-radius: 15px;
  color: #0080ff;
  font-size: 14px;
`;

const UserActions = styled.div`
  display: flex;
  align-items: center;
`;

const UserAction = styled.div`
  margin: 0 10px;
  font-size: 16px;
  color: #aaa;
  cursor: pointer;

  &:hover {
    color: #0080ff;
  }
`;

const UserIcons = styled.div`
  display: flex;
  align-items: center;
`;

const UserIcon = styled.div`
  margin: 0 10px;
  font-size: 25px;
  cursor: pointer;
`;
